import GlobalStyles from "./GlobalStyles";
import styled from 'styled-components'
import Sidebar from '../components/Sidebar';
import Header from './Header';
const Page = ({ children }) => (
  <div>
    <GlobalStyles />

    <FlexWrapper>
      <Sidebar />
      <ChildWrapper>
      {children}
      </ChildWrapper>

    </FlexWrapper>


  </div>
);
const FlexWrapper = styled.div`
  display:flex;
  `
  const ChildWrapper = styled.div`
  flex:1;
  `
export default Page;
